import React from "react";

export const Grid = (source) => {
  return (
	  <table cellspacing="1" cellpading="1">
	    <tbody>
	      {source.map(heading => {
	      <tr>
	        <td>Ali</td>
	        <td>2021-11-05</td>
	        <td>2021-11-14</td>
	      </tr>
              })}
	    </tbody>
	  </table>
  );
}

export default Grid;
